INSERT INTO `amazon_items` VALUES (1,'http://www.amazon.com/Rubies-Star-Wars-Skywalker-Lightsaber/dp/B00160GPES','B00160GPES','Clothing, Shoes & Jewelry',NULL,'Rubies Star Wars Luke Skywalker Lightsaber',9.60,'<div class=\"disclaim\">\n          \n            \n            \n            \n             Size:<strong>One Size</strong>\n            \n          \n            \n            \n            \n                &nbsp;|&nbsp;\n            \n             Color:<strong>Blue</strong>\n            \n          \n          </div>\n        \n      \n    \n  \n\n\n        \n     \n       \n         \n           <h3>Product Description</h3>\n        \n        <p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, Halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Rubies Costume Company has been bringing costumes and accessories to the world since 1950. As the world\'s leader we take seriously the mission to make dressing up fun. Mascots, rental quality costumes, masks, wigs, accessories, shoes and every significant licensed costume you want to wear can be found under the Rubies brand. Still family owned, still family focused, Rubies brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter and all in-between.\n	            \n            </p>',108,2.4,0,'2015-10-05 20:40:00','2015-10-20 15:55:17','2015-10-06 00:40:00'),(2,'http://www.amazon.com/Aeromax-AS-Helmet-Astronaut-Helmet/dp/B00IA5LSH6','B00IA5LSH6','Clothing, Shoes & Jewelry',NULL,'Youth Astronaut Helmet',16.99,'<p>Space flight is easier than ever with our \"New\" Youth size Astronaut Helmet. This space helmet is a little smaller for younger kids to enjoy, but offers rich details, like a moving visor, NASA logo and appealing decorations that inspire kids to dream big. Quality and durability is number one, along with a great price. Recommended for Ages 3-10. WARNING: Choking Hazard - Small Parts Not for children under 3 years.<br>One size fits most ages 3-10.<br>\n	        \n        </p>',111,4.3,2,'2015-10-05 20:40:18','2015-10-21 07:11:24','2015-10-06 00:40:18'),(3,'http://www.amazon.com/CINDERELLA-LIVE-ACTION-82057-Enchanted/dp/B00RYRGXH6','B00RYRGXH6','Clothing, Shoes & Jewelry',NULL,'CINDERELLA LIVE ACTION 82057 Enchanted Waltz Light Up Glass Slippers Costume',11.99,'<p>Sparkle with every step with the Enchanted Waltz Light Up Glass Slippers from Disney\'s Cinderella. Infused with silver glitter, these beautiful jelly shoes light up in the heel and feature and adjustable strap for comfort. Glittery butterflies adorn the toes of these slippers, and \"flutter\" when you walk! Dance the night away in these beautiful light up shoes - or at least until midnight!.\n	        \n        </p>',110,4,2,'2015-10-05 20:40:35','2015-10-20 15:54:41','2015-10-06 00:40:35'),(4,'http://www.amazon.com/Teenage-Mutant-Ninja-Turtles-Leonardos/dp/B00BG34EDO','B00BG34EDO','Clothing, Shoes & Jewelry',NULL,'Teenage Mutant Ninja Turtles Leonardo\'s Katana',8.24,'<h3>Product Description</h3>\n        \n        <p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, Halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Heroes in a half shell - TURTLE POWER! Rubie\'s Costume Company has been bringing costumes and accessories to the world since 1950. As the world\'s leader we take seriously the mission to make dressing up fun. Mascots, rental quality costumes, masks, wigs, accessories, shoes, and every significant licensed costume you want to wear can be found under the Rubie\'s brand. Still family owned, still family focused, Rubie\'s brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter, and all in-between.\n	            \n            </p>',110,4,0,'2015-10-05 20:40:50','2015-10-13 07:41:04','2015-10-06 00:40:49'),(5,'http://www.amazon.com/Rubies-5374-Harry-Potter-Accessories/dp/B000U5KAJQ','B000U5KAJQ','Clothing, Shoes & Jewelry',NULL,'Harry Potter Accessories Kit',9.99,'<p>No Harry Potter costume is complete without this accessories kit.\n	        \n        </p>',120,3.7,2,'2015-10-05 20:41:34','2015-10-20 15:53:34','2015-10-06 00:41:33'),(6,'http://www.amazon.com/Rubies-Captain-America-Soldier-Costume/dp/B00HA4WQVA','B00HA4WQVA','Clothing, Shoes & Jewelry',NULL,'Rubies Captain America: The Winter Soldier Retro Costume Shield, 12\"',13.11,'<div class=\"disclaim\">\n          \n            \n            \n            \n             Size:<strong>12\"</strong>\n            \n          \n            \n            \n            \n                &nbsp;|&nbsp;\n            \n             Color:<strong>Red / White / Sky Blue</strong>\n            \n          \n            \n            \n            \n                &nbsp;|&nbsp;\n            \n             Product Packaging:<strong>Standard Packaging</strong>\n            \n          \n          </div>\n        \n      \n    \n  \n\n\n        \n     \n       \n         \n           <h3>Product Description</h3>\n        \n        <p>Includes: Toy shield. Dimensions: 12\" Diam..\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Marvel Comics and Rubies Costume Company have teamed to outfit you in all the costumes and accessories you need to dress as all of your favorite heroes and villains. Since 1951 Rubies has been the world\'s leader in costumes, decor and accessories, to make celebrating safe and fun. From witches and pirates to vampires and zombies, from Graceland to galaxies far, far away, we know that the Rubies\' Costume Collection will inspire you to a bigger and better Halloween season. Mascots, rental quality costumes, masks, wigs, accessories, shoes and every significant licensed costume you want to wear can be found under the Rubies\' brand. Still family owned, still family focused; Rubies\' brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter and all in-between.\n	            \n            </p>',74,4.3,0,'2015-10-05 20:41:45','2015-10-20 15:52:34','2015-10-06 00:41:45'),(7,'http://www.amazon.com/Melissa-Doug-8525-Dress-Up-Tiaras/dp/B00FZMDCNA','B00FZMDCNA','Clothing, Shoes & Jewelry',NULL,'Melissa & Doug Dress-Up Tiaras',9.99,'<h3>Product Description</h3>\n        \n        <p>Over 25 years ago we started our company in the garage of the home where Doug grew up - we had to be careful not to disturb Doug\'s parents who were still living there! Thanks to your support, we\'ve been able to move into a real office down the road, a building that actually has separate ladies and men\'s bathrooms! Our philosophy has remained the same over the years-to make each and every customer a happy and permanent member of the Melissa &amp; Doug family, while offering products with tremendous value, quality and design. Our line offers something for everyone with over 2,000 innovative products for children of all ages! We\'ve always welcomed customer suggestions, and we continually strive to make improvements to our products. We\'re honored by the faith you place in us and view it as our responsibility to continue to earn your trust in the years to come.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>This fabulous four-pack of dress-up crowns and tiaras gives pretend play the royal touch! Designed in consultation with moms (and their little princesses!), the headband tiaras have been painstakingly designed to be pinch-free, the comb-backed crowns won\'t tangle and all are made with the very best materials we could find--so they\'re tough enough to stand up to years of play and look gorgeous for years to come. These glamorous and durable playtime accessories include four unique designs, each with its own royal style: Two metallic crowns (gold and silver) with recessed beveling shine with painted-jewel accents; two pearlescent tiaras (flowered lavender and jeweled pink) are fit for a prima ballerina or fairy queen. The set coordinates with Melissa &amp; Doug\'s Goodie Tutus dress-up skirts collection and Step In Style dress-up shoes collections.\n	            \n            </p>',217,4.4,2,'2015-10-05 20:42:15','2015-10-13 09:45:59','2015-10-06 00:42:14'),(8,'http://www.amazon.com/Hip-Hop-50s-Shop-Glasses/dp/B008J7BCN0','B008J7BCN0','Clothing, Shoes & Jewelry',NULL,'Hip Hop 50s Shop Cateye Glasses Child/Youth',9.45,'<p>You will be the cat\'s meow when you arrive at the sock hop wearing our Vintage 50\'s Style Cateye Glasses! Irresistible rhinestone accents make this a playful accessory that will add the perfect finishing touch to your outfit. Our glasses are made of durable plastic with clear lenses for a realistic look. We offer 6 colors, so choose a pair to match your poodle skirt, sweater, or even something in your everyday wardrobe!\n	        \n        </p>',81,4.2,2,'2015-10-05 20:42:27','2015-10-20 15:52:55','2015-10-06 00:42:27'),(9,'http://www.amazon.com/Batman-Knight-Rises-Gloves-Gauntlets/dp/B0077GT0OW','B0077GT0OW','Clothing, Shoes & Jewelry',NULL,'Batman: The Dark Knight Rises: Batman Gloves with Gauntlets, Child Size (Black)',8.86,'<h3>Product Description</h3>\n        \n        <p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, Halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>The Dark Knight Rises is the third installment and said to be the final of Christopher Nolan\'s Batman film series. Let your child play along in this action suit, fun all year around, for movie previews, and Batman parties. Remember the Gotham City of old and your friends Commissioner Gordon as you help your little crime fighter save the world from villains. Rubie\'s Costume Company has been bring costumes and accessories to the world since 1950. As the world\'s leader we take seriously the mission to make dressing up fun. Mascots, rental quality costumes, masks, wigs, accessories, shoes, and every significant licensed costume you want to wear can be found under the Rubie\'s brand. Still family owned, still family focused, Rubie\'s brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter, and all in-between.\n	            \n            </p>',104,4.3,0,'2015-10-05 20:42:54','2015-10-21 07:11:44','2015-10-06 00:42:54'),(10,'http://www.amazon.com/Vampire-Plastic-Costume-Accessory-Favors/dp/B003O6F9RQ','B003O6F9RQ','Clothing, Shoes & Jewelry',NULL,'12 White Vampire Fangs, Plastic Teeth, Costume Accessory Party Favors',4.47,'<p>12 White Vampire Fangs, Plastic Teeth\n	        \n        </p>',79,3.9,0,'2015-10-05 20:44:05','2015-10-20 15:54:19','2015-10-06 00:44:05'),(11,'http://www.amazon.com/Rubies-Avengers-Captain-America-Costume/dp/B00SODCTP4','B00SODCTP4','Clothing, Shoes & Jewelry',NULL,'Rubie\'s Avengers 2 Age of Ultron Captain America 12\" Shield Costume',13.90,'<p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, Halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>',9,4.7,0,'2015-10-05 20:44:19','2015-10-06 04:44:13','2015-10-06 00:44:18'),(12,'http://www.amazon.com/Goodie-Tutus-Dress-Up-Set-Collections/dp/B00CPHX76U','B00CPHX76U','Clothing, Shoes & Jewelry',NULL,'Melissa & Doug Goodie Dress-Up Tutus',24.99,'<p>Includes 4 different tutu/skirts. One-size fits most children between the ages of 3-6 years. This is an officially licensed Melissa &amp; Doug costume.\n	        \n        </p>',111,4.8,2,'2015-10-05 20:44:31','2015-10-13 07:43:01','2015-10-06 00:44:31'),(13,'http://www.amazon.com/Colorful-Princess-Party-Tiaras-Assorted/dp/B003JT02MU','B003JT02MU','Clothing, Shoes & Jewelry',NULL,'Colorful Princess Party Tiaras - 12 per unit, Assorted Colors',8.90,'<p>Sparkling metalic tiaras. Semi circle style with combs at sides. Assorted pastel colors: pink, purple, aqua and yellow.\n	        \n        </p>',268,4,2,'2015-10-05 20:44:45','2015-10-20 15:53:13','2015-10-06 00:44:45'),(14,'http://www.amazon.com/Thor-31631-Basic-Helmet/dp/B0049MP8P2','B0049MP8P2','Clothing, Shoes & Jewelry',NULL,'Thor Basic Helmet',16.99,'<div id=\"productDescription_feature_div\" class=\"feature\" data-feature-name=\"productDescription\">\n\n\n\n\n    \n\n    \n    \n    \n        \n            \n                \n	                \n	                \n	                	\n\n\n\n\n	                \n                \n            \n        \n        \n        \n        \n        \n        \n    \n    \n    \n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    </div>',214,4.7,2,'2015-10-05 20:45:00','2015-10-13 07:43:25','2015-10-06 00:44:59'),(15,'http://www.amazon.com/Rubies-Wizard-Glinda-Light-Wand/dp/B00LCVVDOI','B00LCVVDOI','Clothing, Shoes & Jewelry',NULL,'Rubies Wizard of Oz Glinda Light Up Wand',8.35,'<p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, Halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>',29,2.7,0,'2015-10-05 20:45:14','2015-10-06 04:44:54','2015-10-06 00:45:13'),(16,'http://www.amazon.com/Disney-Frozen-Tiara-Crown-Silver/dp/B00LHEQFXO','B00LHEQFXO','Clothing, Shoes & Jewelry',NULL,'Disney Frozen Tiara Crown - Silver with Blue Elsa and Anna Heart Jewel',4.57,'<p>Disney Authentic.\nGenuine tiara crown with Elsa &amp; Anna jewel. \nFor children 3 years and up.\n	        \n        </p>',367,3.3,0,'2015-10-06 05:09:54','2015-10-20 15:57:50','2015-10-06 09:09:54'),(17,'http://www.amazon.com/Bruder-Construction-Toy-Hard-Hat/dp/B000816J7O','B000816J7O','Clothing, Shoes & Jewelry',NULL,'Bruder Construction Toy Hard Hat',6.98,'<h3>Product Description</h3>\n        \n        <p>Bruder Construction Toy Hard Hat\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>On your way to the construction site, don\'t leave the house without your lunch pail and hard hat. The hard hat is a must for the dress up crowd, it completes the look.\n	            \n            </p>',378,4.4,2,'2015-10-06 05:10:10','2015-10-20 15:56:40','2015-10-06 09:10:10'),(18,'http://www.amazon.com/Aeromax-Jr-Cowboy-Bandanna-Black/dp/B004ZWN7FE','B004ZWN7FE','Clothing, Shoes & Jewelry',NULL,'Aeromax Jr. Cowboy Hat with Bandanna, Black',11.99,'<h3>Product Description</h3>\n        \n        <p>Before he goes riding into the sunset, be sure your little cowboy is dressed in authentic rustic gear. The Black Cowboy Hat and Bandana Set is a great way to encourage your little horse rider to protect him from the sweltering heat as he\'s roping in the cattle!\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>See you at the Rodeo! Every cowboy or cowgirl needs a hat to complete the look. This one comes with a bandanna. Yee Haw! Black Hat with Black Bandanna.\n	            \n            </p>',319,4.4,2,'2015-10-06 05:10:26','2015-10-20 15:56:16','2015-10-06 09:10:25'),(19,'http://www.amazon.com/Firefighter-Chief-Hat-Plastic-Child/dp/B0016L0WNM','B0016L0WNM','Clothing, Shoes & Jewelry',NULL,'Firefighter Chief Hat Plastic Child (Set of 12)',5.49,'<p>These fireman\'s helmets are the perfect addition to your themed party. Perfect for classroom dress up or as party favors. Set of 12 one child size helmets. Hats measure approx. 10 1/2\". Not a protective helmet.\n	        \n        </p>',190,3.9,0,'2015-10-06 05:10:55','2015-10-20 15:57:43','2015-10-06 09:10:55'),(20,'http://www.amazon.com/Kangaroo-Black-Derby-Hat/dp/B00LNG91UU','B00LNG91UU','Clothing, Shoes & Jewelry',NULL,'Kangaroo Black Derby Hat',7.45,'<p>This Classic Derby Hat gives you that 19th Century classic look. Our Deluxe Derby hat has a felt-like finish and features a signature round crown, narrow reinforced brim, and matte black hat. One size fits most. All Kangaroo Hats come Shrink wrapped in a Polybag so the hat is never dirty. This Black Bowler Hat will be sure to please at any Black Derby Hat Event. Great Hat for mime costumes &amp; steampunk costumes too! Great Charlie Chaplin hat for Charlie Chaplin costumes! And Terrific for Mary Poppins costumes. Although not designed with this in mind, we have heard customer reports that it\'s been used for costumes for Cousin Itt, Clockwork Orange, Chicago and tons of famous movies &amp; tv shows. Great for Kentucky Derby Hats!\n	        \n        </p>',429,4.8,1,'2015-10-06 05:11:08','2015-10-20 15:55:39','2015-10-06 09:11:08'),(21,'http://www.amazon.com/Toysmith-TSM669-F-Fireman-Hats/dp/B000F4G5HS','B000F4G5HS','Clothing, Shoes & Jewelry',NULL,'Toysmith Fireman Hats',5.65,'<p>Toysmith\'s mission is to supply quality toys and gifts while delivering superior customer service to retailers. We offer products in many key categories including: active play, science &amp; discovery, arts &amp; crafts, impulse &amp; novelty toys, and nostalgic retro classics!  Since our inception in 1981 our owners, Bill and Nancy Smith, have worked very diligently to grow from a small family business, shipping from their garage, to a large office complex and distribution center that stocks and ships over 1,600 products to more than 6000 accounts. However, our philosophy remains the same: maintaining a strong family work environment while offering the best selection and quality of products together with the highest standards of service to all our customers.\n	        \n        </p>',290,4.4,0,'2015-10-06 05:11:21','2015-10-20 15:56:21','2015-10-06 09:11:21'),(22,'http://www.amazon.com/Childrens-Brown-Felt-Cowboy-Hat/dp/B007MS996E','B007MS996E','Clothing, Shoes & Jewelry',NULL,'Children\'s Brown Felt Cowboy Hat',9.58,'<p>Dress For the Wild Wild West. Top off your child\'s cowboy or cowgirl western costume with this adorable Children\'s Brown Felt Cowboy Hat. Your child will steal the show at your upcoming western party in this way out west brown cowboy hat. Lasso this cowboy hat for a western Halloween costume your child won\'t forget! One size fits most children. Approximately 20 circumference around inside of hat. White rope trim with adjustable wooden bead. Made of thick, stiff felt. Our western costumes and cowboy hats are perfect for your upcoming western party or Halloween event. Don\'t miss out on wild west fun! Stock up on the western wear you and your family needs to create a hee-haw good time! Part of Costumes &gt; Hats &amp; Wigs &gt; Cowboy &amp; Western\n	        \n        </p>',145,4,0,'2015-10-06 05:11:34','2015-10-20 15:57:18','2015-10-06 09:11:33'),(23,'http://www.amazon.com/Rhode-Island-Novelty-Blinking-Cowboy/dp/B001BBWLV8','B001BBWLV8','Clothing, Shoes & Jewelry',NULL,'Blinking Pink Tiara Cowboy Hat (Child)',7.59,'<div class=\"a-divider a-divider-section\"><div class=\"a-divider-inner\"></div></div>\n        <h2>\n            Product Description\n        </h2>\n    <div id=\"dp_productDescription_container_div\" class=\"feature\" data-feature-name=\"product