ver the head and make you look just like one of the Ninja Turtles! Eight masks are included with each order.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Let your little ninjas join in on the action with our Teenage Mutant Ninja Turtles Masks! These Teenage Mutant Ninja Turtles Party Masks are ideal TMNT party favors for your child\'s birthday party, perfect for adding Turtle Power to any Ninja Turtles favor bag or using in Teenage Mutant Ninja Turtles party games! This package of 8 Ninja Turtles Paper Masks contains two each of designs featuring Leo, Raph, Donnie and Mikey. Coordinate with other Teenage Mutant Ninja Turtles party favors and Ninja Turtles party supplies for a Turtle-riffic birthday celebration!\n	            \n            </p>',133,4.3,0,'2015-10-06 06:18:33','2015-10-10 11:14:08','2015-10-06 10:18:33'),(30,'http://www.amazon.com/Little-Adventures-Power-Mask-Blue/dp/B00IKTIS1G','B00IKTIS1G','Toys & Games',NULL,'Little Adventures Power Masks - Reversible Child Costume Accessory',5.69,'<p>Any child can be a hero in this newly designed reversible face mask! The soft, comfortable mask, with elastic band, is reversible and allows for many superhero combinations. So, let your imagination run wild! Features: Soft and comfortable for everyday wear. Reversible for many hero combinations. Sizes: One size fits most, 3-8 yrs.\n	        \n        </p>',57,4,0,'2015-10-06 06:18:47','2015-10-20 16:00:01','2015-10-06 10:18:46'),(31,'http://www.amazon.com/Supergirl-Super-Best-Friends-Glitter/dp/B00FOLK3RA','B00FOLK3RA','Clothing, Shoes & Jewelry',NULL,'Supergirl Super Best Friends Glitter Mask',6.68,'<p>My Super Bestfriends combines feminine with superhero play. Items are available in components so you can mix and match the pieces you want: eye masks, leotards; skirts; capes, and glovelettes. For girls 4+. Imagine by Rubies\' Dress-up Collection is full of imagination-inspiring outfits and toys for kids, with the same high quality designs and value-conscience price-points expected from Rubies\'. Just like its parent company, Imagine by Rubies\' will utilize strong everyday licenses and innovative non-license designs that will have boys and girls dressing up 365 days of the year. Some of the popular licenses in the Imagine by Rubies\' line are Hello Kitty, Superman: Man of Steel, DC Com. We hope you enjoy Imagine by Rubies\' and all of its inspiring ideas for developing children\'s imaginations.\n	        \n        </p>\n        \n        \n            \n            <p>Super Best Friends combines feminine with superhero play. Items are available in components so you can mix and match the pieces you want: eye masks, leotards; skirts; capes and glovelettes. For girls 4+. Imagine by Rubies\' Dress-up Collection is full of imagination-inspiring outfits and toys for kids, with the same high quality designs and value-conscience price-points expected from Rubies\'. Just like its parent company, Imagine by Rubies\' will utilize strong everyday licenses and innovative non-license designs that will have boys and girls dressing up 365 days of the year. Some of the popular licenses in the Imagine by Rubies\' line are Hello Kitty, Superman: Man of Steel, DC Com. We hope you enjoy Imagine by Rubies\' and all of its inspiring ideas for developing children\'s imaginations.\n	            \n            </p>',28,4.1,1,'2015-10-06 06:18:59','2015-10-20 17:52:30','2015-10-06 10:18:58'),(32,'http://www.amazon.com/Official-Minecraft-Exclusive-Creeper-Enderman/dp/B00CJF540K','B00CJF540K','Clothing, Shoes & Jewelry',NULL,'Official Minecraft Exclusive Steve, Creeper & Enderman Head Costume Mask Set',53.98,'<p>Official Minecraft Exclusive Steve , Creeper &amp; Enderman Head Costume Mask Set of 3.\nCardboard construction / Officially licensed / Based off of the hit game Minecraft / Easy to see eye holes .\nSize: 12\" x 12\" x 12\" / Perfect for Halloween and costum