</b> \n<br> \n<br> 1xMask\n	        \n        </p>',84,3.9,0,'2015-10-06 06:19:34','2015-10-14 14:22:09','2015-10-06 10:19:33'),(35,'http://www.amazon.com/Child-Halloween-Michael-Myers-Mask/dp/B00BG3461E','B00BG3461E','Clothing, Shoes & Jewelry',NULL,'Child Halloween Michael Myers Mask with Wig',16.99,'<h3>Product Description</h3>\n        \n        <p>Rubie\'s Costume Company has designed quality costume and fun clothing for decades. Trusted to be the leader of cosplay, halloween, and general decor items, Rubie\'s does not sacrifice quality for price. Expect the highest in costume design and material with Rubie\'s.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Rubie\'s Costume Company has been bringing costumes and accessories to the world since 1950. As the world\'s leader we take seriously the mission to make dressing up fun. Mascots, rental quality costumes, masks, wigs, accessories, shoes, and every significant licensed costume you want to wear can be found under the Rubie\'s brand. Still family owned, still family focused, Rubie\'s brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter, and all in-between.\n	            \n            </p>',26,3.6,1,'2015-10-06 06:19:47','2015-10-14 14:23:12','2015-10-06 10:19:47'),(36,'http://www.amazon.com/12-pack-Plastic-Halloween-White-Drama/dp/B002T2T7WE','B002T2T7WE','Clothing, Shoes & Jewelry',NULL,'12-pack Plastic Halloween White Drama Party Kids Face Masks',7.49,'<p>12 Plastic White Face Masks.\nThis blank white mask is perfect for completing a scary Halloween costume or for your very own \"Jabbawockeez\" themed party! The mask is molded like a man\'s face and has slits for the eyes, nostrils and mouth. An elastic strap on the back holds the mask in place. \n\n\nMeasures 6\" x 9\". \nWould make a great \"Jabbawockeez\" theme, Halloween and/or dance party. \nPerfect for creating mime performances! \nIncludes elastic securer. \nFits children and adults. Set of 12.\n	        \n        </p>',112,3.7,1,'2015-10-06 06:20:00','2015-10-14 14:22:54','2015-10-06 10:19:59'),(37,'http://www.amazon.com/Signstek-Latex-Horse-Hooves-Gloves/dp/B00Y7XBZU0','B00Y7XBZU0','Clothing, Shoes & Jewelry',NULL,'Signstek Latex Horse Head Mask with 1 Pair Horse Hooves Gloves',19.99,'<p>1. If you are allergic to latex, don\'t wear this. \n<br> 2. This product is normally have a smelling of latex , you can put it on the Ventilation place for one day. \n<br> 3. Kids under 3 yrs must be under the guidance of parents to use the mask. \n<br>\n	        \n        </p>',4,4,0,'2015-10-06 06:20:11','2015-10-06 14:29:20','2015-10-06 10:20:10'),(38,'http://www.amazon.com/Official-Minion-Shades-Goggles-Exclusive/dp/B00ZE65LUO','B00ZE65LUO','Clothing, Shoes & Jewelry',NULL,'Official Minion Shades Mask Goggles Minion Movie Exclusive!',11.99,'<p>Its a high quality made Minion goggles. Join the Minion teams and have some fun.\n	        \n        </p>',2,4,1,'2015-10-06 06:20:22','2015-10-13 07:49:21','2015-10-06 10:20:21'),(39,'http://www.amazon.com/Batman-Knight-Rises-Child-Black/dp/B0077GSZM0','B0077GSZM0','Clothing, Shoes & Jewelry',NULL,'Child Batman Full Mask',15.89,'<p>If you\'ve noticed your child practicing his martial arts moves in the living room, or throwing his own makeshift Batarangs across the house, don\'t be surprised. He\'s just training to be the next Batman. Now, Bruce Wayne didn\'t have anyone but Alfred to help him out, but since you ARE there to give your kid a hand, how about helping him protect his identity while he\'s out fighting the criminals of Gotham City with a licensed Dark Knight Rises Mask. Sure, it might not be a Batmobile, but it\'s a start.\n	        \n        </p>',41,4,2,'2015-10-06 06:20:35','2015-10-14 14:22:18','2015-10-06 10:20:34'),(40,'http://www.amazon.com/Marvel-Ultimate-Spider-Man-Hero-Mask/dp/B00AOKCZ0O','B00AOKCZ0O','Clothing, Shoes & Jewelry',NULL,'Marvel Ultimate Spi