nd amazing price for the value, Disguise won\'t let you down when it comes to fun dress up time.\n	        \n        </p>\n        \n        \n            \n                <h3>From the Manufacturer</h3>\n            \n            <p>Blue and gold beaded tiara.\n	            \n            </p>',15,3.2,2,'2015-10-06 23:51:59','2015-10-13 08:04:35','2015-10-07 03:51:59'),(100,'http://www.amazon.com/Fun-Express-Metal-Rhinestone-Flower/dp/B00342H8JC','B00342H8JC','Clothing, Shoes & Jewelry',NULL,'Fun Express Metal Rhinestone Flower Girl Tiara',9.99,'<p>A great metal tone rhinestone tiara for a flowergirl or a princess party.Rhinestone metal tone tiara.One size fits most.Height 1\".Combs on the side hold it in place.\n	        \n        </p>',56,3.8,2,'2015-10-06 23:52:12','2015-10-13 08:04:48','2015-10-07 03:52:12'),(101,'http://www.amazon.com/Subtle-Addition-Little-Girls-Fedora/dp/B00SVRHZTI','B00SVRHZTI','Clothing, Shoes & Jewelry',NULL,'Subtle Addition Unisex-child Fedora Hats',14.99,'<p>Fedora sun hats for little boys &amp; little girls. In both formal dress up and fun styles. They go well with all types of little boys clothes and little girls clothes. Great for toddlers and kids in the age range of 2 to 6 years old. Toddlers love wearing these hats and you\'ll love how they look in them. Size is Toddler/Child Medium with a inside circumference of the hat measuring 20.5 - 21.25 inches / 52cm - 54cm. Be sure to measure the circumference of your child\'s head. These hats make a great fashion addition to your toddler boys clothes or girls clothes. It\'s a clothing accessory that every child should have in their closet. (Pick up a few bow ties by searching item 859961004875) These headpieces are the perfect toppers for costumes as well. What\'s a gangster outfit without a Fedora hat? The hats are also great for school plays and performances or buy them as gifts for the kids and grand kids. Use them to dress the little ones up for church, family pictures and Easter Sunda