es and every significant licensed costume you would ever want to wear can be found under the Rubie\'s brand. Rubie\'s brings you fun for every season: Halloween, Christmas, Mardi Gras, Easter and all in-between!\n	            \n            </p>',142,3.1,1,'2015-10-08 07:10:13','2015-10-08 07:10:13','2015-10-08 11:10:12'),(148,'http://www.amazon.com/Rubies-After-Trick---Treat-Purse/dp/B00HZH6YQK','B00HZH6YQK','Clothing, Shoes & Jewelry',NULL,'Rubies Ever After High, Tea Pot Trick-or-Treat Purse',14.83,'<p>Since 1951 Rubies has been the world\'s leader in costumes, decor and accessories - everything you need to make celebrating safe and fun! From witches and pirates to vampires and zombies, from Graceland to galaxies far, far away the Rubies Costume Collection will inspire you to a bigger and better Halloween season! Mascots, rental quality costumes, masks, wigs, accessories, shoes and every significant licensed costume you want to wear can be found under the Rubies brand. Still family owned, still family focused; Rubies brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter and all in-between.\n	        \n        </p>',6,0,1,'2015-10-08 07:10:42','2015-10-08 07:10:42','2015-10-08 11:10:41'),(149,'http://www.amazon.com/Rubies-30292-Mortal-Kombat-Scorpion/dp/B008JFE3AQ','B008JFE3AQ','Clothing, Shoes & Jewelry',NULL,'Scorpion Sword',12.99,'<p>Now you can finish off your Scorpion costume just like Scorpion finishes off his opponent in Mortal Kombat! This weapon is colorful, detailed and officially licensed. It\'s a must-have for anyone who loves the Mortal Kombat games or for someone interested in cosplay.\n	        \n        </p>',29,3.9,1,'2015-10-08 07:10:54','2015-10-08 07:10:54','2015-10-08 11:10:54'),(150,'http://www.amazon.com/Comics-Reversible-Batman-Superman-Cape/dp/B0077DAK3U','B0077DAK3U','Clothing, Shoes & Jewelry',NULL,'DC Comics, Reversible Batman and Superman Cape',14.00,'<h3>Product Description</h3>\n        \n        <p>Have your Batma