er</h3>\n            \n            <p>Whether it\'s play time or trick-or-treat time your kids will love the feeling of this embroidered cape blowing in the wind. Rubies Costume Company has been bringing costumes and accessories to the world since 1950. As the world\'s leader we take seriously the mission to make dressing up fun. Mascots, rental quality costumes, masks, wigs, accessories, shoes and every significant licensed costume you want to wear can be found under the Rubies brand. Still family owned, still family focused; Rubies brings you fun for every season, Halloween, Christmas, Mardi Gras, Easter and all in-between.\n	            \n            </p>',100,4,1,'2015-10-08 07:11:39','2015-10-08 07:11:39','2015-10-08 11:11:38'),(153,'http://www.amazon.com/elope-440301-Slytherin-Necktie/dp/B0006H5MI2','B0006H5MI2','Clothing, Shoes & Jewelry',NULL,'Slytherin Necktie',19.95,'<p>This 100% silk Necktie from the Harry Potter movies measures 140 cm in length and features a printed Slytherin patch. <br>\n	        \n        </p>\n        \n        \n            \n            <p>This officially licensed Slytherin tie is a replica of the one worn by the students of the Slytherin house in the Harry Potter movies. The green and grey silk tie also features an imprint of the Slytherin Coat of Arms. Makes a great addition to any Harry Potter costume or everyday wear!\n	            \n            </p>',76,4.8,1,'2015-10-08 07:11:53','2015-10-14 14:26:24','2015-10-08 11:11:52'),(154,'http://www.amazon.com/Harry-Potter-Childs-Dementor-Hands/dp/B000V9VNBK','B000V9VNBK','Health & Personal Care',NULL,'Kid\'s Dementor Hands',12.01,'<p>Includes a pair of Dementor character gloves that look like the Dementor hands. One size fits most children. This is an officiallyl licensed Harry Potterand#153; product.\n	        \n        </p>',14,3.1,1,'2015-10-08 07:12:07','2015-10-08 07:12:07','2015-10-08 11:12:06'),(155,'http://www.amazon.com/Batman-Knight-Child-Joker-Gloves/dp/B001E6J0RI','B001E6