Cradle for iPhone 6 Plus 5s 5c 4s Samsung Galaxy S6 S6 Edge S5 S4 S3 Note 4 3 Nexus LG Nokia Xperia Moto Oneplus One+ HTC etc.',9.99,'<div class=\"disclaim\">\n          \n            \n            \n            \n             Color:<strong>TT-SH07</strong>\n            \n          \n          </div>\n        \n      \n    \n  \n\n\n        \n        \n     \n	       \n     \n                              \n     \n       	       \n        \n         \n        \n        	\n        	\n        		\n        			<p>Survive the spills, live for the thrills. The TaoTronics TT-SH07 Windshield Smartphone Holder is a simple, easy to use holder for your phone. Using a super tight suction cap, the holder sticks to almost any flat or textured surface - put it on your dashboard or window-shield and the holder will keep your phone safe and secure during those hairpin turns. Please check our more information below.\n				    	\n					</p>',2731,3.8,1,'2015-10-15 11:04:00','2015-10-15 11:04:00','2015-10-15 15:04:00'),(269,'http://www.amazon.com/SCOSCHE-MagicMount--Magnetic-Mobile-devices/dp/B00I608BJ8','B00I608BJ8','Cell Phones & Accessories',NULL,'SCOSCHE MagicMount- Magnetic Dash Mount for Mobile devices - Car Mounts - Frustration-Free Packaging - Black',14.27,'<p>Magnetic Dash Mount for Mobile devices- MagicMount is a new magnetic mounting system for conveniently mounting smartphones and more. Just hover your device near the magnetic surface and it instantly locks securely in place. Its sleek cradle-free design uses high-powered magnets to secure your device where you use them most. Place your device at any angle for convenient viewing. On the road, at the office, at home, everyWHERE. Place your device at any angle for convenient viewing. Secure the MagicMount with the automotive-grade 3M adhesive. Install the MagicPlate behind your case or battery cover, directly to your rugged case or directly to your device. Works with: GPS, iPod, iPhone, iPad, Smartphones, Tablets. A Larger and s