e and essentials any longer. Daily essentials such as cellphones, tissue bags, lighter, cigarette, keys, pen, and even jewelry can be stuffed in this sturdy, high quality nylon net bag . Stick it just about anywhere in your car to start organizing your phone and essentials! \n<br>\n	        \n        </p>',4,1.7,1,'2015-10-20 12:30:15','2015-10-20 12:30:15','2015-10-20 16:30:14'),(275,'http://www.amazon.com/Nettech-Windshield-Universal-Smartphone-Smartphones/dp/B0160940H8','B0160940H8','Cell Phones & Accessories',NULL,'Nettech long arm Windshield Universal Smartphone Car Mount Holder Cradle for Iphone 6s Samsung Galaxy S6 HTC Nexus Lg and All Smartphones',8.99,'<p>Nettech 360 Degree Rotation Long Arm/Neck Smartphone Car Mount \n<br> This is Nettech 360 Degree Rotation Long Arm/Neck Smartphone Car Mount \n<br> This is nettech new update version for long arm car mount,design for your windshield and dashboard,A new window car mount.Provide a good view angle while you drive. \n<br> \n<br> Features: \n<br> -Fits many types of smartphone on market,which the screen from 3.2\"-6\". \n<br> -Adjustable clamp can hold up to 3.54 inches for width. \n<br> -Shockproof design,providing a stable viewing environment and adjustable size secure from falling \n<br> -Easy installation no need tools. Strong suction with Three layer,perfect to your car. \n<br> -Full 360 degree rotation.you can adjust best position for your driving. \n<br> Seller Warranty: \n<br> With 100% Satisfaction, If you have any question ,please contact us immediately and we will be happy to exchange it or refund you the total amount We offer 90 day money back guarantee in case you are not 100% satisfied and wish to return the product for ANY reason.We supply best service. We are committed to 100% satisfaction for our customers so \"Add to Cart\" now! \n<br> \n<br>\n	        \n        </p>',8,4.4,1,'2015-10-20 12:30:25','2015-10-20 12:30:25','2015-10-20 16:30:24'),(276,'http://www.amazon.com/TOTOP%C2%AE-MagGrip-Magnetic-Universal-Samsung/dp/B0151JHRDW','B0151JHRDW','Cell Phones & Accessories',NULL,'Car Mount, TOTOP® MagGrip CD Slot Magnetic Universal Car Mount Holder for the Samsung Galaxy S6/S6 Edge/S5, LG G4, Apple iPhone 6/5S/5C/5/4S/4, HTC One M7/M8/M9, Amazon Fire Phone',11.99,'<div class=\"disclaim\">\n          \n            \n            \n            \n             Size:<strong>for CD Slot</strong>\n            \n          \n            \n            \n            \n                &nbsp;|&nbsp;\n            \n             Color:<strong>black</strong>\n            \n          \n          </div>\n        \n      \n    \n  \n\n\n        \n     \n       \n         \n        <p><b>Size:MagGrip CD Slot | Color:Black <br> Introducing the TOTOP MagGrip CD Slot Car Mount<br> The TOTOP MagGrip CD Slot Car Mount is a sturdy, cradle-less, attractive device holding system focused on simplicity. Simply place the included slim, MagGrip plate inside the case of your device and insert the MagGrip CD Slot Car Mount into the CD player slot on your car. The strong magnetic surface of the mount will ensure that your device is secure, while the cradle-less feature enables you to completely view your device without any distracting arms and holders - Designed with Drivers in Mind <br> Compatible with : <br> Almost all smartphones. Some popular compatible models are as follows: <br> iPhone 6/6 Plus/5S/5C/5/4S/4/3 <br> Samsung Galaxy S6/S6 Edge/S5/S4/S3, Note 3/4<br> HTC One/One X/One S/M7/M8/M9<br> Nexus 5/4 <br> Lg G3 <br> Note: The metal plate/sticker may affect the wireless charging for some devices. <br></b>\n	        \n        </p>',2,4,1,'2015-10-20 12:30:35','2015-10-20 12:30:35','2015-10-20 16:30:35'),(277,'http://www.amazon.com/Lifetime-Warranty-Universal-Smartphones-Packaging/dp/B00P2SC6BQ','B00P2SC6BQ','Cell Phones & Accessories',NULL,'[Lifetime Warranty] Okra® Universal Powerful Magnetic Vent Car Mount For iPhone 6/5s/5c/4s, Galaxy S5/S4/S3/S2, HTC One & All Smartphones And GPS Devices (Retail Packaging)',8.99,'<p></p><p><b> Okra® Universal Powerful Magnetic Vent Car Mount For iPhone 6 Plus/6/5s/5c/4s, Galaxy S5/S4/S3/S2, HTC One &amp; All Smartphones And GPS Devices </b></p> \n<p>The Okra Vent Car Mount is a sleek and durable mounting system, focused on simplicity and built for convenience. Simply place one of the the two included lightweight slim and powerful rectangular metal plates inside the case of your device or place one of the 2 included round powerful magnetic plates on the back of your device using the adhesive back, and attach the Okra magnetic clip to your car\'s air vent. The strong-powered magnet will ensure that your device is secure, while the cradle-less feature enables you to easily rotate, fix, or tilt to any angle that best assists the viewer of the device, without any distracting arms and holders - Designed with Drivers in Mind </p> \n<b>Features:</b> \n<p> • Includes 2 rectangle Magnetic Plates + 2 Circle 3M adhesive Magnetic Plates <br> • The Magnetic Plates Are Designed To Work Through Any Case You Have On Your Smartphone <br> • Universal Smartphone, Cellphone mount compatible with all devices <br> • Quality rubber gripping maximizes friction to reduce slippage, minimizes road vibrations, and allows smooth interaction when gesturing or tapping your phone. <br> • Lifetime Warranty Included </p> \n<p> <b>In the Box:</b></p> \n<p> Okra Magnetic Vent Mount <br> 2x Rectangle Magnetic Plates <br> 2x Circle 3M adhesive Magnetic Plates <br> Warranty Registration Card</p> \n<p> <b>Enjoy Okra® Products Limited Lifetime Warranty </b> </p> \n<p> Purchase this products worry free, as every Okra Product comes with a Lifetime Warranty. Simply register your product after your purchase to enjoy this exclusive benefit. </p>\n	        \n        <p></p>',748,4.4,1,'2015-10-20 12:31:15','2015-10-20 12:31:15','2015-10-20 16:31:15'),(278,'http://www.amazon.com/TOTOP-Universal-Rotating-Bracket-Samsung/dp/B014R57YX4','B014R57YX4','Cell Phon