ivel Technology</b> </p> \n<p>Easily achieve the perfect angle using Roybens new 360 degree Swivel Technology with the use of ball sockets and tightening nuts. </p> \n<p><b>Secure Mount</b></p> \n<p>The suction cup is made of high quality heat-resistant material, secure mount on the windshield or any other smooth surfaces.</p> \n<p><b>One-hand Operation</b></p> \n<p>Easily place your phone or release it from the holder by one press on the release button.</p> \n<p><b>Easy to Install</b></p> \n<p>A super simple setup lets you install the mount in minutes. Need to change position? Just lift up the suction pad and stick it down again. Vrooooom!</p> \n<p> </p> \n<p><b>Package Includes: </b></p> \n<p>1 x Roybens smartphone holder</p> \n<p>1 x suction cup mount</p> \n<p>1 x Air Vent mount</p>\n	        \n        <p></p>',31,3.6,1,'2015-10-20 12:31:56','2015-10-20 12:31:56','2015-10-20 16:31:56');
